(function(e,t){$.getJSON("js/icons.json").done(function(e){$.each(e,function(n){t=(t?t+",":"")+e[n].id});$.ajax("https://itunes.apple.com/lookup",{cache:!0,dataType:"jsonp",jsonpCallback:"showIcons",data:{id:t}}).done(function(t){var n=$("<div/>").attr("data-icons",t.resultCount).addClass("grid__wrapper").appendTo("body");$.each(t.results,function(r){$("<div/>").addClass("grid__item icon__wrapper").hide().append('<a href="'+e[r].url+'" class="icon__item">'+'<img alt="'+e[r].name+'" src="'+t.results[r].artworkUrl100+'">'+"</a>").appendTo(n).delay(200*r).fadeIn()})})})})();